import { StyleSheet } from "react-native";

export default StyleSheet.create({
    background: {
        flex: 1,
        alignItems: "center",
        justifyContent: "center",
        backgroundColor: "#DFDFDF",
      },
      container: {
        flex: 1,
        width: "80%",
        maxHeight: "70%",
        margin: "10%",
        backgroundColor: "#A4E3F9",
        borderRadius: 10,
        borderWidth: 2,
        borderColor: "#004A85",
        shadowColor: "black",
        shadowOffset: {
          width: 0,
          height: 12,
        },
        shadowOpacity: 0.58,
        shadowRadius: 16.0,
        elevation: 24,
      },
      Logo: {
        alignItems: "center",
        justifyContent: "center",
        marginTop: "10%",
      },
      login: {
        flex: 1,
        alignItems: "center",
        justifyContent: "center",
      },
      input: {
        backgroundColor: "#F5F5F5",
        width: "90%",
        marginBottom: 15,
        color: "#000000",
        fontSize: 17,
        borderRadius: 10,
        padding: 10,
      },
      btn: {
        backgroundColor: "#004A85",
        width: "90%",
        height: 45,
        alignItems: "center",
        justifyContent: "center",
        borderRadius: 10,
      },
      btn2: {
        width: "90%",
        height: 45,
        alignItems: "flex-end",
        justifyContent: "center",
      },
      textBtn: {
        color: "#ffffff",
        fontSize: 18,
      },
});
